const initialState = {
  startDate: "",
  endDate: ""
};

const dataReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'ADD_STARTDATE':
      return {
        ...state,
        startDate: [...state.startDate, ...action.payload]
      };
    case 'ADD_ENDDATE':
      return {
        ...state,
        endDate: [...state.endDate, ...action.payload]
      };
    default:
      return state;
  }
};

export default dataReducer;
